import React, {Component} from 'react'
import LogList from './LogList'
import { connect } from 'react-redux'
import { addLog } from '../actions'

class LogListContainer extends Component {
  render(){
    return(
      <div>
        <h3 className="code-logs">Code Logs</h3>
        <LogList addLog={this.props.addLog}/>
      </div>
    )
  }
}

const mapStateToProps = state => {
  return {
    logs: state.logReducer.logs,
    loading: state.logReducer.loading
  }
}

export default connect(mapStateToProps, {addLog})(LogListContainer)
